import React from 'react';
import { Link } from 'react-router-dom';

import './MovieItem.css';

const PerformanceItem = props => {
  return (
    <tr>
      <td>
        {props.userid}
        </td>
        <td>
        {props.status}
        </td>
        <td>
        {props.time}
        </td>
     </tr>

  );
};

export default PerformanceItem;
